function writeSeedText(wPxStart, hPxStart, canvasId, seed) {
    var canvas = document.getElementById(canvasId);
    var context = canvas.getContext("2d");
    context.globalCompositeOperation = "source-over";
    context.fillStyle = 'black';
    context.textAlign = "start";
    context.font = "bold 14px Arial";
    context.fillText("Private seed trytes:", wPxStart, hPxStart);

    hPxStart += 32;

    for (var i = 0; i < 9; i++) {
        var seedPart = "";
        for (var j = 0; j < 9; j++) {
            seedPart += seed[((i * 9) + j)];
        }

        context.fillText(seedPart, wPxStart, hPxStart);

        hPxStart += 18;
    }
}

function writeCanvasText(size, wPxStart, hPxStart, canvasId, textAlign, text) {
    var canvas = document.getElementById(canvasId);
    var context = canvas.getContext("2d");
    context.fillStyle = 'black';
    context.globalCompositeOperation = "source-over";
    context.textAlign = textAlign;

    context.font = "bold " + size + "px Arial";
    context.fillText(text, wPxStart, hPxStart);
}

function writeQrData(wPxStart, hPxStart, canvasId, stringValue, size, ecc) {
    var qr = new QRious({
        backgroundAlpha: 0,
        foreground: 'black',
        foregroundAlpha: 1,
        level: ecc,
        size: size,
        value: stringValue
    });

    var pngData = qr.toDataURL();

    var canvas = document.getElementById(canvasId);
    var context = canvas.getContext("2d");

    var image = new Image();
    image.onload = function () {
        context.globalCompositeOperation = "source-over";
        context.drawImage(image, wPxStart, hPxStart);
    };
    image.src = pngData
}

