function writeDataToCanvas(designOption, canvasId, tintOption) {
    var canvas = document.getElementById(canvasId);
    var context = canvas.getContext("2d");

    var image = new Image();
    image.onload = function () {
        context.drawImage(image, 0, 0);

        if (tintOption !== "0") {

            context.globalCompositeOperation = "hue";

            switch (tintOption) {
                case "1": context.fillStyle = '#00FFFF'; //cyan
                    break
                case "2": context.fillStyle = '#3378FF'; //violet
                    break;
                case "3": context.fillStyle = '#FF00FF'; //purpura
                    break;
                case "4": context.fillStyle = '#FF0000'; //magenta
                    break;
                case "5": context.fillStyle = '#FFD700'; //gold
                    break;
            }

            context.fillRect(0, 0, canvas.width, canvas.height);
        }

        var seed = null;
        if (seedOptionPicked === 1) {
            seed = manuallyEnteredSeed;
        }
        else if (seedOptionPicked === 2) {
            seed = seedGenerated;
        }

        writeQrData(54, 83, canvasId, seed, 150, "H");
        if (designOpt !== "0") {
            writeCanvasText("14", 582, 72, canvasId, "center", "Public address QR:");
            writeQrData(508, 84, canvasId, addressGenerated, 147, "Q");
            writeCanvasText("14", 582, 252, canvasId, "center", "");
            if (designOpt === "2") {
                writeCanvasText("8", 352, 26, canvasId, "center", "SEED: " + seed);
                writeCanvasText("8", 352, 297, canvasId, "center", "ADR: " + addressGenerated);
            }

            writeCanvasText("14", 582, 252, canvasId, "center", customNote);
        }
        else {
            writeSeedText(517, 72, canvasId, seed);
        }

        writeCanvasText("14", 127, 72, canvasId, "center", "Private seed QR:")
        writeCanvasText("14", 127, 252, canvasId, "center", "Checksum: " + getSeedChecksum(seed));


    };
    image.src = getBase64ImageData(designOption);
}

