function createSeedGeneratorBox() {
    var html = '<table id="seed_generation_table">';
    var trEnd = false;
    for (var i = 0; i < 81; i++) {
        if (i % 9 === 0) {
            if (i === 0) {
                html += '<tr><td id="td_' + i + '" class="td_style"></td>';
            }
            else {
                html += '</tr><tr><td id="td_' + i + '" class="td_style"></td>';
            }
        }
        else {
            html += '<td id="td_' + i + '" class="td_style"></td>';
        }
    }
    html += "</tr></table>";

    document.getElementById("seed_generation_table").innerHTML = html;
}

function resetIndexPositionArray() {
    if (intervalFunctionHandle !== null) {
        clearInterval(intervalFunctionHandle);
    }

    createSeedGeneratorBox();
    indexPositionArray = new Array(81);
    for (var i = 0; i < indexPositionArray.length; i++) {
        indexPositionArray[i] = i;
    }

    document.getElementById("set_tryte_text").innerText = "SET TRYTE (0%)"
}

function startCryptoGenerator(resetGenerator) {
    if (resetGenerator) {
        if (autoGenerateHandle) {
            clearTimeout(autoGenerateHandle);
        }
        resetIndexPositionArray();
        seedGenerated = null;
        seedGeneratedArray = new Array(81);
        autoGenerationCommencing = false;
    }
    generatorSeedIndex = indexPositionArray[generateRandomNumber(0, indexPositionArray.length)];
    indexToRemoveFromIndexPositionArray = indexPositionArray.indexOf(generatorSeedIndex);
    indexPositionArray.splice(indexToRemoveFromIndexPositionArray, 1);

    $("#td_" + generatorSeedIndex).toggleClass("td_style td_style_active");

    startGeneratingRandomTrytes();
}

function clearHandles()
{
    if (autoGenerateHandle)
    {
        clearTimeout(autoGenerateHandle);
    }
    if (intervalFunctionHandle)
    {
        clearTimeout(intervalFunctionHandle);
    }   
}

function startGeneratingRandomTrytes() {
    intervalFunctionHandle = setInterval(function () { updateSeedGeneratorIndex(); }, 10);
}

function updateSeedGeneratorIndex() {

    lastGeneratedTryte = getRandomTryte();
    document.getElementById("td_" + generatorSeedIndex).innerText = lastGeneratedTryte;
}

function setTryte(userInteraction) {
    if (!seedGenerated) {
        clearInterval(intervalFunctionHandle);
        $("#td_" + generatorSeedIndex).toggleClass("td_style_active td_style");
        document.getElementById("td_" + generatorSeedIndex).innerText = lastGeneratedTryte;
        seedGeneratedArray[generatorSeedIndex] = lastGeneratedTryte;
        if (indexPositionArray.length > 0) {
            document.getElementById("set_tryte_text").innerText = "SET TRYTE (" + Math.round((1 - (indexPositionArray.length / 81)) * 100) + "%)";
            startCryptoGenerator(false);
            if (autoGenerationCommencing) {
                if (!userInteraction) {
                    setNewSimulatedInteractionTimeout();
                }
            }
        }
        else {
            setGeneratedSeed()
            document.getElementById("set_tryte_text").innerText = "DONE! CHECKSUM: " + getSeedChecksum(seedGenerated);
            if (autoGenerationCommencing) {
                autoGenerationCommencing = false;
            }
        }
    }
}

function setNewSimulatedInteractionTimeout() {
    autoGenerateHandle = setTimeout(function () { setTryte(false); }, 10 * generateRandomNumber(generateRandomNumber(13, 20), generateRandomNumber(53, 98)));
}

function autoGenerateSeed() {
    startCryptoGenerator(true);
    autoGenerationCommencing = true;
    setNewSimulatedInteractionTimeout();
}

function getSeedChecksum(seed) {
    return iota.utils.addChecksum(seed, 3, false).substr(-3);
}

function setGeneratedSeed() {
    seedGenerated = "";
    for (var i = 0; i < 81; i++) {
        seedGenerated += seedGeneratedArray[i];
    }
}

function prev() {
    if (!transitionInProgress) {
        if (progress !== 1) {

            switchContent(getDivWithProgressNumber(progress), getDivWithProgressNumber(progress - 1));
            if (progress === 4) {
                addressGenerated = null;
                document.getElementById("seed_address_table").style.display = "none";
                document.getElementById("address_note").style.display = "none";
            }

            if (progress === 5) {
                document.getElementById("custom_note").className = "hidden";
            }

            if (progress === 3)
            {
                if(seedOptionPicked === 2)
                {
                    clearHandles();
                }
            }

            progress--;
            setNewDescription(progress);
        }
    }
}
function next() {
    if (!transitionInProgress) {
        if (progress !== 5) {

            if (progress === 2) {
                if (!seedOptionPicked) {
                    return;
                }
                else {
                    if (seedOptionPicked === 2) {
                        if (!seedGenerated) {
                            startCryptoGenerator(true);
                        }
                    }
                }
            }

            if (progress === 3) {

                if (seedOptionPicked === 1) {
                    if (!manuallyEnteredSeed) {
                        return;
                    }
                    else {
                        showLoadingScreen("GENERATING ADDRESS...");
                        printSeed();
                        setTimeout(function () { getAndSetAddress(); }, 500);
                    }
                }
                else if (seedOptionPicked === 2) {
                    if (!seedGenerated) {
                        return;
                    }
                    else {
                        clearHandles();
                        showLoadingScreen("GENERATING ADDRESS...");
                        printSeed();
                        setTimeout(function () { getAndSetAddress(); }, 500);
                    }
                }
                else {
                    return;
                }
            }

            if (progress === 4) {
                if (designOpt === "0" || designOpt === "1") {
                    writeDataToCanvas(1, "currency_graphics_print", tintOpt);
                }
                else {
                    writeDataToCanvas(2, "currency_graphics_print", tintOpt);
                }

                if (designOpt !== "0") {
                    $("#custom_note").toggleClass("hidden show");
                    document.getElementById("input_custom_note").value = customNote;                    
                }
            }

            switchContent(getDivWithProgressNumber(progress), getDivWithProgressNumber(progress + 1));
            progress++;
            setNewDescription(progress);
        }
    }
}

function updateAddress(incrementIndex) {
    if (incrementIndex) {
        keyIndex++;
    }

    showLoadingScreen("GENERATING ADDRESS...");
    setTimeout(function () { getAndSetAddress(); }, 500);
}

function resetKeyIndex() {
    keyIndex = 0;
    updateAddress(false);
}

function showLoadingScreen(message) {
    document.getElementById("loading_screen").innerText = message;
    document.getElementById('loading_screen').style.display = 'block';
}

function hideLoadingScreen() {
    document.getElementById("loading_screen").innerText = "";
    document.getElementById('loading_screen').style.display = 'none';
}

function getAndSetAddress() {
    var seed = null;
    if (seedOptionPicked === 1) {
        seed = manuallyEnteredSeed;
    }
    else if (seedOptionPicked === 2) {
        seed = seedGenerated;
    }

    var options = {};
    options.index = keyIndex;
    options.security = parseInt(document.getElementById("sec_opt").value);
    options.deterministic = "off";
    options.checksum = true;
    options.total = 1;

    iota.api.getNewAddress(seed, options, function (e, address) {
        addressGenerated = address[0];
        document.getElementById("address_print").innerText = addressGenerated
        hideLoadingScreen();

        document.getElementById("key_index").innerText = keyIndex;

        $("#seed_address_table").fadeIn(300, function () {

            if (designOpt === "0") {
                document.getElementById("address_note").innerText = "NOTE: YOU HAVE PICKED A DESIGN WHICH WILL NOT PRINT THE ADDRESS";
            }
            else
            {
                document.getElementById("address_note").innerText = "";
            }
            $("#address_note").fadeIn(200, function () {
            });
        });
    });
}

function printSeed() {
    if (seedOptionPicked === 1) {
        document.getElementById("seed_print").innerText = manuallyEnteredSeed;

    }
    else if (seedOptionPicked === 2) {
        document.getElementById("seed_print").innerText = seedGenerated;
    }

}

