function getRandomTryte() {
    return tryteArray[generateRandomNumber(0, tryteArray.length)];
}

function generateRandomNumber(minimum, maximum) {
    var valueRange = maximum - minimum;
    var requestBytes = Math.ceil(Math.log2(valueRange) / 8);
    if (!requestBytes) {
        return minimum;
    }
    var maxNumberValue = Math.pow(256, requestBytes);
    var unsignedInt8Array = new Uint8Array(requestBytes);

    while (true) {
        crypto.getRandomValues(unsignedInt8Array);

        var value = 0;
        for (var i = 0; i < requestBytes; i++) {
            value = (value << 8) + unsignedInt8Array[i];
        }

        if (value + valueRange - (value % valueRange) < maxNumberValue) {
            return minimum + (value % valueRange);
        }
    }
}

function getBase64ImageData(designOption) {
    switch (designOption) {
        case 1: return "data:image/png;base64,";
            break;
        case 2: return "data:image/png;base64,";
            break;
    }
}